The Killers are an American rock band from Las Vegas, Nevada, formed in 2002. The group consists of Brandon Flowers (lead vocals, keyboards), Dave Keuning (guitar, vocals), Mark Stoermer (bass guitar, vocals) and Ronnie Vannucci Jr. (percussion, drums).

Part of the post-punk revival movement, The Killers draw influence from music styles of the 1980s and 1990s. The group's debut album, Hot Fuss (2004) brought the band mainstream success. The Killers' second album, Sam's Town, was released in 2006, and the compilation album Sawdust containing B-sides, rarities, and new material, was released in 2007. The band's first two albums have sold in excess of 16 million copies worldwide combined and their third studio album, Day &amp; Age, produced by Stuart Price, was released in November 2008.

